.globl main
main:
	li $s0, BASE_ADDRESS
	li $s1, MAX_ADDRESS
	jal clear
	
start_init:
	la $s2, Level
	sw $zero, 0($s2)	# Initializes Level in $s2 and sets level to menu screen
	
	la $s3, Player		# Initializes Player in $s3 and sets player health to 3
	li $t0, 3
	sw $t0, 12($s3)
	
	la $s4, Fires		# Initializes Fires in $s4
	
jal draw_menu_screen
init_menu:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, keypress_happened_menu	# handle user input for menu screen
	j init_menu

keypress_happened_menu:
	lw $t7, 4($t9)
	beq $t7, 112, keypress_p		# Restart the game if press p
	beq $t7, 27, end_program		# Exit the game if press escape
	beq $t7, 10, init_level_1		# Go to level 1 if press enter
	j init_menu
	

keypress_p:
	# restart the game
	j main
	
	
	
game_loop:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, keypress_happened	# handle user input
	
	#If no input and game done
	lw $t0, 0($s2)			# If on win or lose screen, do nothing till press p
	beq $t0, 5, sleep_game_loop
	beq $t0, 6, sleep_game_loop
	
	#If no input and game not done, clear sprites
	lw $a0, 0($s3)
	lw $t0, 0($s2)
	beq $t0, 4, clear_final_level
	clear_normal:
	jal clear_player
	j clear_player_done
	clear_final_level:
	jal clear_player_sky
	clear_player_done:
	lw $a0, 24($s3)
	j update_states
	
keypress_happened:
	lw $t7, 4($t9)
	beq $t7, 112, keypress_p		# Restart the game if press p
	
	lw $t0, 0($s2)				# If on win or lose screen, do nothing till press p
	beq $t0, 5, sleep_game_loop
	beq $t0, 6, sleep_game_loop
	
	# Clear sprites
	lw $a0, 0($s3)
	lw $t0, 0($s2)
	beq $t0, 4, clear_final_level_2
	clear_normal_2:
	jal clear_player
	j clear_player_done_2
	clear_final_level_2:
	jal clear_player_sky
	clear_player_done_2:
	
	
	#Keypress detection
	beq $t7, 119, keypress_w	# Jump
	beq $t7, 97, keypress_a		# Left
	beq $t7, 100, keypress_d	# Right
	beq $t7, 32, keypress_space 	# Shoot
	beq $t7, 10, keypress_enter 	# Dash
	
	j update_states

