dash_right_1:
	lw $t0, 0($s3)
	addi $t0, $t0, 4
	sw $t0, 0($s3)
	sw $zero, 32($s3)
	j set_fall_state

dash_right_2:
	lw $t0, 0($s3)
	addi $t0, $t0, 8
	sw $t0, 0($s3)
	sw $zero, 32($s3)
	j set_fall_state
	
dash_right_3:
	lw $t0, 0($s3)
	addi $t0, $t0, 12
	sw $t0, 0($s3)
	sw $zero, 32($s3)
	# If dash complete, start falling
	lw $t0, 8($s3)
	bge $t0, DASH_DURATION, set_fall_state
	#Otherwise add 1 to duration
	addi $t0, $t0, 1
	sw $t0, 8($s3)
	
	j end_player_update

fall_state:
	lw $t0, 0($s3)
	addi $t0, $t0, 6144
	
	# if character is on a platform, set to appropriate action
	lw $t3, 0($t0)
	beq $t3, FLOOR, set_stand_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	beq $t3, WIN_FLOOR, init_win
	lw $t3, 4($t0)
	beq $t3, FLOOR, set_stand_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	beq $t3, WIN_FLOOR, init_win
	lw $t3, 8($t0)
	beq $t3, FLOOR, set_stand_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	beq $t3, WIN_FLOOR, init_win
	lw $t3, 12($t0)
	beq $t3, FLOOR, set_stand_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	beq $t3, WIN_FLOOR, init_win
	lw $t3, 16($t0)
	beq $t3, FLOOR, set_stand_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	beq $t3, WIN_FLOOR, init_win
	
	
	# Nothing below player
	lw $t0, 0($s3)
	addi $t0, $t0, 512
	sw $t0, 0($s3)
	
	j end_player_update
	
jump_state:
	lw $t0, 0($s3)
	addi $t0, $t0, -512
	
	#If surface above player, take appropriate action
	lw $t3, 0($t0)
	beq $t3, FLOOR, set_fall_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	lw $t3, 4($t0)
	beq $t3, FLOOR, set_fall_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	lw $t3, 8($t0)
	beq $t3, FLOOR, set_fall_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	lw $t3, 12($t0)
	beq $t3, FLOOR, set_fall_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	lw $t3, 16($t0)
	beq $t3, FLOOR, set_fall_state
	beq $t3, FIRE_PRIMARY_COLOUR, take_damage
	beq $t3, DOOR, increase_level
	
	# Since no collision, move player up one
	lw $t0, 0($s3)
	addi $t0, $t0, -512
	sw $t0, 0($s3)
	
	#Set to fall if jump duration is complete
	lw $t0, 8($s3)
	bge $t0, JUMP_DURATION, set_fall_state
	#Otherwise add 1 to duration
	addi $t0, $t0, 1
	sw $t0, 8($s3)
	j end_player_update
	
	
	
set_stand_state:
	# set the state of the player to standing
	sw $zero, 4($s3)
	sw $zero, 8($s3)
	li $t0, 1
	sw $t0, 32($s3)		#Make dash available
	j end_player_update
	
set_fall_state:
	li $t0, 2	#Set state to fall
	sw $t0, 4($s3)
	sw $zero, 8($s3)	#Set duration of state to 0
	j end_player_update

end_player_update:
	lw $a0, 8($s4)	# Load locaton of fire 1
	lw $t0, 0($s4)
	# Draw fire or background based on fire state
	beq $t0, 0, fire_1_dead
fire_1_alive:
	jal draw_fire
	j fire_1_draw_done
fire_1_dead:
	jal clear_fire
fire_1_draw_done:
	lw $a0, 12($s4)	# Load locatrion of fire 2
	lw $t0, 4($s4)
	# Draw fire or background based on fire state
	beq $t0, 0, fire_2_dead
fire_2_alive:
	jal draw_fire
	j fire_2_draw_done
fire_2_dead:
	jal clear_fire
fire_2_draw_done:

	#Draw water
	lw $t0, 28($s3)		#Checks if water is active
	beqz $t0, draw_water_done
	lw $a0, 24($s3)
	jal clear_water
	j update_water
	post_water_update:
	lw $t0, 28($s3)		#Checks if water is active
	beqz $t0, draw_water_done
	beq $t0, 1, left_water	#Checks which direction to draw water
	beq $t0, 2, right_water
left_water:
	lw $a0, 24($s3)
	jal draw_water_left
	j draw_water_done
	
right_water:
	lw $a0, 24($s3)
	jal draw_water_right
	
draw_water_done:
	# Draw player
	lw $a0, 0($s3)
	lw $t0, 20($s3)
	lw $t1, 4($s3)
	beqz $t0, draw_player_left
	beq $t0, 1, draw_player_right
draw_player_left:
	beq $t1, 3, draw_player_left_dash
	beq $t1, 0, draw_player_left_stand
	j draw_player_left_jump
draw_player_left_jump:
	jal draw_jump_left
	j draw_player_done
draw_player_left_dash:
	jal draw_dash_left
	j draw_player_done
draw_player_left_stand:
	jal draw_player_standing_left
	j draw_player_done
draw_player_right:
	beq $t1, 3, draw_player_right_dash
	beq $t1, 0, draw_player_right_stand
	j draw_player_right_jump
draw_player_right_jump:
	jal draw_jump_right
	j draw_player_done
draw_player_right_dash:
	jal draw_dash_right
	j draw_player_done
draw_player_right_stand:
	jal draw_player_standing_right
	j draw_player_done

draw_player_done:
	j sleep_game_loop
	
update_water:
	lw $t0, 28($s3)			#No shot active, skip to end of loop
	beqz $t0, update_fire
	beq $t0, 1, update_water_left
	beq $t0, 2, update_water_right
	
update_water_left:
	#Check water collision directly on left			
	lw $t0, 24($s3)
	addi $t0, $t0, -4
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, turn_off_water
	addi $t0, $t0, 512
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, turn_off_water
	
