	#Check water collision directly on right
	lw $t0, 24($s3)
	addi $t0, $t0, 12
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, turn_off_water
	addi $t0, $t0, 512
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, turn_off_water
	
	#Check if room for water to move 1 space
	lw $t0, 24($s3)
	addi $t0, $t0, 16
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, water_right_1
	addi $t0, $t0, 512
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, water_right_1
	
	#Check if room for water to move 2 spaces
	lw $t0, 24($s3)
	addi $t0, $t0, 20
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, water_right_2
	addi $t0, $t0, 512
	lw $t1, 0($t0)
	bne $t1, BACKGROUND, water_right_2
	
	j water_right_3
	
water_right_1:
	lw $t0, 24($s3)
	addi $t0, $t0, 4
	sw $t0, 24($s3)
	j update_fire
water_right_2:
	lw $t0, 24($s3)
	addi $t0, $t0, 8
	sw $t0, 24($s3)
	j update_fire
water_right_3:
	lw $t0, 24($s3)
	addi $t0, $t0, 12
	sw $t0, 24($s3)
	j update_fire
	
turn_off_water:
	sw $zero, 28($s3)
	j update_fire
update_fire:

	j post_water_update

sleep_game_loop:
	#Sleep and return to main loop
	li $v0, 32
	li $a0, SLEEP_TIME
	syscall
	j game_loop

take_damage:
	# If damage is taken then restart at correct level
	lw $t0, 12($s3)		# Lower Health by 1
	addi $t0, $t0, -1
	sw $t0, 12($s3)
	beq $t0, 0, init_game_over
	lw $t1, 0($s2)		# restart correct level
	beq $t1, 1, init_level_1
	beq $t1, 2, init_level_2
	beq $t1, 3, init_level_3
	beq $t1, 4, init_level_4
increase_level:
	lw $t1, 0($s2)		# Get level in $t1
	addi $t1, $t1, 1	# Increase the level by 1
	sw $t1, 0($s2)
	beq $t1, 2, init_level_2
	beq $t1, 3, init_level_3
	beq $t1, 4, init_level_4
	
init_level_1:
	# Initialize Level
	li $t0, 1				# Set Level to 1
	sw $t0, 0($s2)
	
	# Initialize player
	li $t0, LEVEL_1_SPAWN			# Level 1 spawn
	sw $t0, 0($s3)
	sw $zero, 4($s3)			# Set state to standing
	sw $zero, 8($s3)			# Set duration of state
	sw $zero, 16($s3)			# Set to not hurt
	li $t0, 1				# Set direction to right
	sw $t0, 20($s3)
	li $t0, 0x100101DC
	sw $t0, 24($s3)				# Set address of bullet to something that works
	sw $zero, 28($s3)			# Set bullet to not active
	li $t0, 1
	sw $t0, 32($s3)				# Set dash to available
	
	# Initialize fires
	li $t0, 1
	sw $t0, 0($s4)
	sw $t0, 4($s4)
	li $t0, FIRE_1_SPAWN_1
	sw $t0, 8($s4)
	li $t0, FIRE_2_SPAWN_1
	sw $t0, 12($s4)

	
	jal draw_level_1_screen		# Draw level 1 screen
	lw $t0, 12($s3)
	
	beq $t0, 3, three_health
	beq $t0, 2, two_health
	beq $t0, 1, one_health
