	jal draw_heart
	li $a0, LEVEL_1_SPAWN
	jal draw_player_standing_right			#Draw player at level 1 spawn point
	li $a0, FIRE_1_SPAWN_1		#Draw Fire 1 at Level 1 spawn point
	jal draw_fire
	li $a0, FIRE_2_SPAWN_1		#Draw Fire 2 at Level 1 spawn point
	jal draw_fire
	
