	li $a0, FIRE_2_SPAWN_3		#Draw Fire 2 at Level 3 spawn point
	jal draw_fire
	
	j game_loop
init_level_4:
	# Initialize Level
	li $t0, 4				# Set Level to 4
	sw $t0, 0($s2)
	
	# Initialize player
	li $t0, LEVEL_4_SPAWN			# Level 4 spawn
	sw $t0, 0($s3)
	sw $zero, 4($s3)			# Set state to standing
	sw $zero, 8($s3)			# Set duration of state
	sw $zero, 16($s3)			# Set to not hurt
	li $t0, 1				# Set direction to right
	sw $t0, 20($s3)
	li $t0, 0x100101DC
	sw $t0, 24($s3)				# Set address of bullet to something that works
	sw $zero, 28($s3)			# Set bullet to not active
	li $t0, 1
	sw $t0, 32($s3)				# Set dash to available
	
	# Initialize fires
	li $t0, 1				#Turn fires on
	sw $t0, 0($s4)
	sw $t0, 4($s4)
	li $t0, FIRE_1_SPAWN_4
	sw $t0, 8($s4)
	li $t0, FIRE_2_SPAWN_4
	sw $t0, 12($s4)

	
	jal draw_level_4_screen		# Draw level 4 screen
	lw $t0, 12($s3)
	
	beq $t0, 3, three_health4
	beq $t0, 2, two_health4
	beq $t0, 1, one_health4
	three_health4:
	li $a0, HEART_1_SPAWN		# Draw Hearts
	jal draw_heart
	two_health4:
	li $a0, HEART_2_SPAWN
	jal draw_heart
	one_health4:
	li $a0, HEART_3_SPAWN
	jal draw_heart
	li $a0, LEVEL_4_SPAWN
	jal draw_player_standing_right			#Draw player at level 4 spawn point
	li $a0, FIRE_1_SPAWN_4		#Draw Fire 1 at Level 4 spawn point
	jal draw_fire
	li $a0, FIRE_2_SPAWN_4		#Draw Fire 2 at Level 4 spawn point
	jal draw_fire
	
	j game_loop
	
init_game_over:
	jal draw_game_over_screen
	j game_done_loop
	
	

