	j game_done_loop

game_done_loop:
	li $t9, 0xffff0000
	lw $t8, 0($t9)
	beq $t8, 1, keypress_happened_game_done	# handle user input for menu screen
	j game_done_loop

keypress_happened_game_done:
	lw $t7, 4($t9)
	beq $t7, 112, keypress_p		# Restart the game if press p
	j game_done_loop

	
